(9, '0000-00-00 00:00:00', '2012-04-20 13:37:36', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Add', 'we will send this mail to\r\nuser, when a admin add a new user.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\n\n##SITE_NAME## team added you as a user in ##SITE_NAME##.\n\nYour account details.\n##LOGINLABEL##:##USEDTOLOGIN##\nPassword:##PASSWORD##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME,PASSWORD, LOGINLABEL, USEDTOLOGIN'),
