(16, NULL, 0, 'Terms of use', 'terms-of-use', '<p>The terms and conditions herein govern the use of this website,&nbsp;<a href="/" target="_blank">tatkalcare.com</a>&nbsp;("Website") including its online services, such as use of software on Website to book and cancel appointments, information, articles , news, blogs and text, graphics, images and information obtained from service providers and any other material contained on the Website ("Materials") provided by TatkalCare.com. These terms and conditions are compliant with IT ( intermediaries guidelines) Rules, 2011 passed under IT Act,2000.<br /> <br /> The following terms and conditions apply to any user that visits this Website, registered users including prospective patients or their relatives/friends, registered Service providers/Vendors (and for the purposes of these terms and conditions include, medical practitioner/hospital/pathlab/ pharmacy/clinic, (Service Providers/Vendors) that are registered on the Website ( jointly or severally referred to as "User(s)" herein as the context may require ). You''re browsing and/or registration on the Website implies your unconditional acceptance of these terms and conditions which will be final and binding. If you disagree with these Terms of Service, please do not access or use this Website. Tatkal Care reserves the right to unilaterally change the terms of use of the Website and its Online Services without notice as may be required from time to time. We will advise you to read the terms for regular updations each time you visit the Website or use any of its services. TatkalCare.com reserves the right of deleting any account or information contained on the Website without notice for any reason whatsoever.<br /> <br /> Tatkal Care is only a technical facilitator that aims to provide a platform for accessing information on healthcare, prevention, symptoms and cure of common diseases and ailments and directory of healthcare service providers, merchant directory of vendors of medical equipments and other supplies. It provides a software to book appointment with health care service providers registered on the Website. It allows a registered service provider /vendor to publish on the Website its contact information in its online directory, its locations, key doctor''s profile, main departments, advertise their services, health packages , upload photos, videos, events, seminar information, and fee schedule and timings for doctor consultations ("Profile page") by accessing its user id and password allocated at time of registration.<br /> <br /> Registered Service providers/Vendors are solely responsible for quality of Services they provide. Tatkal Care accepts no responsibility for any medical, legal or financial consequences or implications arising out of use of the Website, including any Online Services. Tatkal Care disclaims any warranties express or implied connected with use of the Website including its quality, availability or accuracy, which are provided on an "AS IS" basis.<br /> <br /> Criteria and Restrictions for the Use of this Website The Users of this Website should be of 18 years of age or older. A User is responsible to verify that use of this Website shall be legal and he uses it only for lawful purposes. Therefore, any User who accesses the Website from within India or outside shall access the Website entirely at his own risk and remain responsible for compliance with the laws of his jurisdiction. In addition provisions relating to the absence of liability of TatkalCare.com and owners, its licensors and Indemnity, survive the expiration or termination of these Terms and Use for any reason whatsoever. Tatkal Care makes no claim that the Materials on the Website, are appropriate, accurate, reliable, or updated, suitable or complete or may be downloaded in a particular jurisdiction and your use of the Website shall be at all times solely at your discretion and risk.<br /> <br /> Your Registration with TatkalCare.com being a health care portal provides for free online registration to its Users. TatkalCare.com accepts registration of Service provider /Vendor to provide health care services to Users on payment of Annual Membership fees stipulated from time to time. In addition to the Annual membership fees.<br /> <br /> As part of registration process, you will be provided with an e-mail address and allowed to create a password. These are your credentials for accessing the Services that are only available to registered users ( "Credentials"). You should keep your Credentials private and not share your Credentials with anyone else. If you forget your password, there is a link "Forgot Password?" on the login section of TatkalCare.com. Click on the link and enter your previously registered e-mail address. A mail will be generated and sent to your email address with your password details. You are responsible for notifying us if your password has been hacked or stolen. You may notify us by sending an email to<a href="mailto:vikshay56@gmail.com">vikshay56@gmail.com</a>. Users should at all times maintain secrecy and confidentiality of the log in id and password allocated to it by Tatkal Care. At no time will Tatkal Care be liable for any failure to maintain confidentiality of the access password by User.<br /> <br /> Facilities to be rendered by the Website<br /> &bull; To provide general information on healthcare and directory of registered health care service providers.<br /> <br /> &bull; To publish on the Website contact information about the registered service provider in its online directory, its locations, key doctor''s profile, main departments, and fee schedule and timings for doctor consultations ("Profile page").<br /> <br /> &bull; To provide a log in id and password to enable registered Service provider to create, update, and make any changes in its Profile Page as required.<br /> <br /> &bull; To provide an online system to every registered Service Provider to maintain a database of patient lists of Users to communicate through e-mail or SMS.<br /> <br /> &bull; To provide Users who are registered on the Website technical features to create their profile, edit/update it including contact information, add doctor to a favorite list, seek queries from doctor, invite friends to join the portal, contact the Tatkal Care through contact details on Website, publish /review testimonials on Service provider''s profile pages, request for booking appointments, subscribe for newsletter e-mail/ SMS alerts, receive SMS/e-mail incase of cancellation of appointment by a registered Service provider.<br /> <br /> &bull; To provide to Users through SMS/e-mail notifications about any seminars or events, or health check up camps being organized by registered Service Providers.<br /> &bull; At Tatkal Care sole discretion, Tatkal Care may seek other avenues to advertise services of Service Provider on facebook and other social networking sites or otherwise in any online forum or Portal.<br /> <br /> Responsibilities of Registered Service Provider/Vendors<br /> (i) Registered Service provider/Vendor shall be solely responsible for assuring it has the valid licences and registration with concerned statutory Authorities to practice and advise Users on healthcare and render medical consultations and advice through the Website. Breach of this condition will make concerned registered Service providers or Vendor entirely liable for legal actions or other consequences arising there from.<br /> <br /> (ii) Registered Service Providers /Vendors shall maintain true and correct particulars of its contact information on its Profile pages, including locations, telephone numbers, e-mail addresses, timings, doctors profiles of different departments, provision of contact information to make for Users to make online booking of appointments with its doctors. The registered service provider/vendor &nbsp;shall be solely responsible for seeking &nbsp;consent of doctors before providing their profile details and verifying that only correct and updated information is provided to Tatkal Care for publishing on the Website. The Registered service provider/vendor shall &nbsp;also inform and obtain consent from its doctors that their profiles shall be promoted on Internet through web promotion activities connected with the &nbsp;Website. Prior to submitting contact information and detailed profiles, registered service provider/vendor shall ensure it has the required authorizations as stated in this clause and the information provided by them shall be duly signed and stamped by its authorized representative for the records of the Website .Incase there are any subsequent changes to the supplied profiles , the same shall be duly intimated to the Website in writing, duly signed and stamped by the registered service provider/vendor so that these changes may be made.The Website publishes profiles either uploaded by registered service provider /vendor &nbsp;themselves &nbsp;or that is provided by them after due verification for publication on the Website. In case of any issue concerning consent or accuracy of any content provided by them, Users should approach the registered service provider/vendor directly. Incase a user notifies Website of any incorrect information or description published on the Website provided by registered service provider/vendor , the only obligation of the Website will be to remove or deactivate the concerned link on the Website.However, the Website shall not be responsible for deactivating the said inaccurate profile or information from other websites on the Internet where the information may have been published due to web promotion activities in connection with the Website.<br /> <br /> (iii) Service Provider shall depute one or two persons or more as may be required to attend to User''s request for online booking, booking confirmations and cancellations of appointments with doctors on the Website on a 24x7 hour basis. Portal is only providing information related to healthcare and means of communication and platform to interact with Users. Registered Service Provider shall be fully responsible for maintaining highest professional standards and be solely responsible for all consultations/advice rendered to Users.<br /> <br /> (iv) Registered Service provider shall confirm the booking requests for appointments made by Users in time and inform of any cancellations atleast 24 hrs prior to the scheduled appointment.<br /> <br /> (v) Registered Service Provider shall ensure he is available to diagnose patient at the confirmed time of appointment at the specified location as communicated in writing to the User through the Website or phone/SMS/toll free number of call centre of Tatkal Care.<br /> <br /> (vi) Registered Service provider shall acknowledge he is registered with the Website when indicated or crosschecked by a User for his satisfaction.<br /> <br /> (vii) Registered Service provider will ensure that any patient data of Users shared with its employees, doctors or staff members shall remain confidential at all times.<br /> <br /> TatkalCare.com not a substitute for sound professional advice, treatment or diagnosis The Information that you obtain or receive from TatkalCare.com is for information purposes and to facilitate selecting and scheduling appointments with service providers/vendors registered on the Website. At no point of time TatkalCare.com is a substitute for professional medical advice, personal medical attention or seeking advice from a professional doctor through an onsite visit.Further, no information from this Website should be used for treating or diagnosing a medical or health condition or for replacing any relationship with your physician or other qualified healthcare provider. Online consultation feature should be used only for minor ailments or healthcare queries. Users are advised to visit a registered Service provider for any serious condition or emergency assistance or other ailments. Moreover, no medications, diet supplements or treatments as may be described or prescribed on this Website (including through online consultations) should be taken or begun without first consulting your physician or other healthcare provider.<br /> <br /> Tatkal Care or its owners, managers, directors, employees, agents, partners, advertisers or affiliates will not be liable for any loss, damage, injury caused to a User arising out of use of the Website, its Online services or Materials including legal actions arising out of medical negligence or other third party actions due to professional misconduct or omissions/acts of other users on the Website such as registered Service providers/Vendors.<br /> <br /> Tatkal Care does not establish Doctor Patient relationship though the Website acts as a channel between doctor and patient, it takes neither responsibility nor guarantee regarding the prescription of any drug or treatment. The User upon registering on Website is free to consult any doctor or physician of his/her choice and such registration does not bind him to use the information or registered Service Provider on the Website. The Website maintains transparency with its Users and leaves no room confusion or misunderstanding.<br /> <br /> Further, you also agree that the registered Service Providers on the Website may not be available at all times or may discontinue their association with Website. The registered service provider or Vendors are independent contractors in private practice and are neither employees nor agents of Tatkal Care and/ or its subsidiaries or affiliates and we take no responsibility as to the qualifications of these Service providers/vendors or the correctness of medical advice they provide. Any information on the Website relating to listing, name, content, material of any professional or firm found on this Website does not constitute any endorsement or recommendations of Tatkal Care. When deciding to take advice and/or hire any medical practitioner''s services or healthcare entity, you should do your own independent research as to the accuracy of the credentials expressed in the Materials.<br /> <br /> Tatkal Care not to be held responsible for any third party contentThe User agrees that he will neither use the Website for advertisement purposes or for any commercial messages nor post anything false, defamatory, inaccurate, abusive, harassing, obscene, sexually oriented or threatening message or material that is illegally invasive of another person''s privacy. Though Website provides facility to Users to post blogs, articles but Tatkal Care is not liable for such third party content posted on the Website. Incase any User finds any content is objectionable or illegal, he may report to Tatkal Care by writing at the customer care helpline e-mail address/phone number provided on the Website. Objectionable /illegal content will be monitored and blocked from public access within 36 hrs from reporting of the complaint. Such third party content is not edited or monitored by Tatkal Care and does not reflect approval of TatkalCare.com, its owners, managers, directors, employees, agents, partners, advertisers or affiliates. It bears no responsibility for the posts or the information contained therein. If such information posted is infringing or objectionable, Tatkal Care is not liable and shall take appropriate legal action against concerned User for posting such content.<br /> <br /> Prohibited activities<br /> The Users shall not use any computer resource or communication device to host, display, upload, modify, publish, transmit, update or share any information on the Portal or in connection with Portal on another web resource that &mdash;<br /> (a) belongs to another person and to which the user does not have any right to;<br /> (b) is grossly harmful, harassing, blasphemous defamatory, obscene, pornographic, paedophilic, libellous, invasive of another''s privacy, hateful, or racially, ethnically objectionable, disparaging, relating or encouraging money laundering or gambling, or otherwise unlawful in any manner whatsoever;<br /> (c) harm minors in any way;<br /> <br /> (d) infringes any patent, trademark, copyright or other proprietary rights;<br /> <br /> (e) violates any law for the time being in force;<br /> <br /> (f) deceives or misleads the addressee about the origin of such messages or communicates any information which is grossly offensive or menacing in nature;<br /> <br /> (g) impersonate another person;<br /> <br /> (h) contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer resource;<br /> <br /> (i) threatens the unity, integrity, defence, security or sovereignty of India, friendly relations with foreign states, or public order or causes incitement to the commission of any cognisable offence or prevents investigation of any offence or is insulting any other nation.<br /> <br /> Tatkal Care that operates the Website and hosts /publishes the third party information, upon obtaining knowledge by itself or when brought to actual knowledge by an affected person in writing or through email signed with electronic signature about any such information as mentioned in sub-rule above, shall act within thirty six hours and where applicable, work with User or Service provider or owner of such information to disable such information.<br /> <br /> Tatkal Care and its Copyright Content/TrademarkThe content of the Website is copyrighted and is protected by copyright laws applicable in India. Tatkal Care reserves the right over its Copyrighted content. No one is allowed to use the Copyrighted content as it will amount to breach of the Terms and Conditions and will be violation of copyright laws. The trademark of TatkalCare.com is also protected by law and other trademarks on the Website belong to their respective owners. Tatkal Care shall own and retain all right in and